import React, { Component } from 'react'
import Header from './Header'
import Meta from './Meta'

export default class Page extends Component {
  render() {
    return (
      <div>
        <Meta />
        <Header />
        <p>Hey Im the page component</p>
        {this.props.children}
      </div>
    )
  }
}
